import React from 'react';
import injectContext, { Consumer } from '../store/appContext';
import Counter from './counter';

const App = () => {
	return (
		<Consumer>
			{({ store, actions }) => {
				return <Counter />;
			}}
		</Consumer>
	);
};

export default injectContext(App);
